/*******************************************************************************
* INLINE FUNCTION DEFINITIONS
*******************************************************************************/
inline static void SET_BIT(uint8* var, uint8 pos)
{
  *var |= (uint8)((0xFFU) & ((uint8)(0x01U) << (pos)));
}

inline static void CLR_BIT(uint8* var, uint8 pos)
{
  *var &= (uint8)((0xFFU)^(uint8)((0x01U) << (pos)));
}

inline static uint8 TEST_BIT(const uint8* var, uint8 pos)
{
  return *var & ((uint8)((0x01U) << (pos)));
}

inline static void SET_FLAG(uint32 bit, uint8* flag)
{
  SET_BIT(&flag[bit/(8U)], (uint8)(bit % (8U)));
}

inline static void RESET_FLAG(uint32 bit, uint8* flag)
{
  CLR_BIT(&flag[bit/(8u)], (uint8)(bit % (8U)));
}

inline static uint8 CHECK_FLAG(uint32 bit, const uint8* flag)
{
  return TEST_BIT(&flag[bit/(8u)], (uint8)(bit % (8U)));
}

inline static TickType GET_BASE_COUNTER_VAL(TickType base_cnt, TickType off)
{
  return base_cnt + off;
}

inline static TickType RTE_CAL_SYNC_OFFSET_REVERSE(TickType cur_cnt, TickType base_cnt, TickType off, TickType cycle)
{
  RTE_UNUSED(cycle);
  return (GET_BASE_COUNTER_VAL(base_cnt, off) - cur_cnt);
}

inline static TickType RTE_CAL_SYNC_OFFSET_FORWARD(TickType cur_cnt, TickType base_cnt, TickType off, TickType cycle)
{
  TickType LddRetVal = 0;
  if ((((cur_cnt) - GET_BASE_COUNTER_VAL((base_cnt), (off))) % (cycle)) == 0)
  {
    LddRetVal = 0;
  }
  else
  {
    LddRetVal = ((cycle) - (((cur_cnt) - GET_BASE_COUNTER_VAL((base_cnt), (off))) % (cycle)));
  }
  return LddRetVal;
}

inline static TickType RTE_CAL_SYNC_OFFSET(TickType cur_cnt, TickType base_cnt, TickType off, TickType cycle)
{
  TickType LddRetVal = 0;
  if (cur_cnt > GET_BASE_COUNTER_VAL(base_cnt, off))
  {
    LddRetVal = RTE_CAL_SYNC_OFFSET_FORWARD(cur_cnt, base_cnt, off, cycle);
  }
  else
  {
    LddRetVal = RTE_CAL_SYNC_OFFSET_REVERSE(cur_cnt, base_cnt, off, cycle);
  }
  return LddRetVal;
}

inline static void Rte_DisableInterrupt(void)
{
  __DI();
}
inline static void Rte_EnableInterrupt(void)
{
  __EI();
}

