    Rte_GucComMMode_BCAN_CurrentMode_modeSwitchPort_ComMMode_BCANBswM = RTE_MODE_MDG_ComMMode_NO_COM;
    Rte_GucComMMode_BCAN_NewMode_modeSwitchPort_ComMMode_BCANBswM = Rte_GucComMMode_BCAN_CurrentMode_modeSwitchPort_ComMMode_BCANBswM;
    Rte_GucComMMode_BCAN_OldMode_modeSwitchPort_ComMMode_BCANBswM = Rte_GucComMMode_BCAN_CurrentMode_modeSwitchPort_ComMMode_BCANBswM;
    Rte_GucDcmDiagnosticSessionControl_CurrentMode_modeSwitchPort_DcmDiagnosticSessionControlBswM = RTE_MODE_DcmDiagnosticSessionControl_DCM_DEFAULT_SESSION;
    Rte_GucDcmDiagnosticSessionControl_NewMode_modeSwitchPort_DcmDiagnosticSessionControlBswM = Rte_GucDcmDiagnosticSessionControl_CurrentMode_modeSwitchPort_DcmDiagnosticSessionControlBswM;
    Rte_GucDcmDiagnosticSessionControl_OldMode_modeSwitchPort_DcmDiagnosticSessionControlBswM = Rte_GucDcmDiagnosticSessionControl_CurrentMode_modeSwitchPort_DcmDiagnosticSessionControlBswM;
    Rte_GucEcuMode_CurrentMode_modeSwitchPort_EcuModeBswM = RTE_MODE_EcuMode_ECUM_STATE_STARTUP_ONE;
    Rte_GucEcuMode_NewMode_modeSwitchPort_EcuModeBswM = Rte_GucEcuMode_CurrentMode_modeSwitchPort_EcuModeBswM;
    Rte_GucEcuMode_OldMode_modeSwitchPort_EcuModeBswM = Rte_GucEcuMode_CurrentMode_modeSwitchPort_EcuModeBswM;
    Rte_GucInitState_CurrentMode_modeSwitchPort_InitStateBswM = RTE_MODE_MDG_InitState_START;
    Rte_GucInitState_NewMode_modeSwitchPort_InitStateBswM = Rte_GucInitState_CurrentMode_modeSwitchPort_InitStateBswM;
    Rte_GucInitState_OldMode_modeSwitchPort_InitStateBswM = Rte_GucInitState_CurrentMode_modeSwitchPort_InitStateBswM;
    Rte_GucWakeupEvent_CurrentMode_modeSwitchPort_WakeupEventBswM = RTE_MODE_MDG_WakeupEvent_INITIAL_MODE;
    Rte_GucWakeupEvent_NewMode_modeSwitchPort_WakeupEventBswM = Rte_GucWakeupEvent_CurrentMode_modeSwitchPort_WakeupEventBswM;
